import '../styles/Form.css'

function Form({ onSubmit, setLocation, location }) {
  return (
    <div className="form__container">
    <form>
        <input value={location} type="text" placeholder="Search Location" autoComplete='off' onChange={(event) => setLocation(event.target.value)}/>
        <div>
            <button onClick={onSubmit} type="submit">Search</button>
        </div>
    </form>
    </div>

  );
}

export default Form;
